import React, { useEffect, useState } from 'react';
import { fetchChurnResults } from '../utils/api';

const Churn = () => {
  const [data, setData] = useState({ actual: [], predicted: [] });

  useEffect(() => {
    fetchChurnResults().then(setData);
  }, []);

  return (
    <div>
      <h2>Spotify Churn Prediction</h2>
      <table>
        <thead>
          <tr>
            <th>Actual</th>
            <th>Predicted</th>
          </tr>
        </thead>
        <tbody>
          {data.actual.map((value, index) => (
            <tr key={index}>
              <td>{value}</td>
              <td>{data.predicted[index]}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Churn;
